import React from 'react';
import './About.css';
import TypingText from './TypingText';

const About = () => {
  return (
    <div className="about">
      <div className="about-left">
        <h1>About Me</h1>
      </div>
      <div className="about-divider"></div>
      <div className="about-right">
        <TypingText />
        <p></p>
      </div>
    </div>
  );
};

export default About;
